import React from 'react';
import { Nav } from 'react-bootstrap';
import { NavLink } from 'react-router-dom';

const AnimalSidebar = () => {
  return (
    <div>
      <Nav className="flex-column">
        <Nav.Link as={NavLink} to="#" active>Animales</Nav.Link>
        <Nav.Link as={NavLink} to="#">Perros en adopción</Nav.Link>
        <Nav.Link as={NavLink} to="#">Gatos en adopción</Nav.Link>
        <Nav.Link as={NavLink} to="#">Casos urgentes</Nav.Link>
        <Nav.Link as={NavLink} to="#">Animales adoptados</Nav.Link>
      </Nav>
    </div>
  );
};

export default AnimalSidebar;
